import React from 'react';
import './HomePage.css';

import Logo from '../assets/110pm_EMBL-300X360.png'

const HomePage = () => {
  return (
    <div className= 'homePage'>
      <div className='headerContainer' style={{backgroundImage: Logo }}>
        <h1>ΠΟΛΕΜΙΚΗ ΑΕΡΟΠΟΡΙΑ</h1>
        <h2>110ΠΜ - ΟΣΣΕΑΥ</h2>
        <p>“Μαχιμώτατοι οι ισχύοντες”</p>
      </div>
    </div>
  )
}

export default HomePage;
